Daytime Population","vintage":"2025","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Total Daytime Population in the geographic area. Total Daytime Population includes workers (civilian, non-military employed at work, and armed forces personnel ages 16+) and residents (population age 0-15, unemployed adults, those not in the labor force, and employed civilians who are not working temporarily due to illness, vacation, etc.). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOPWRK_CY":{"type":"number","alias":"2025 Daytime Pop: Workers","vintage":"2025","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Daytime Population who are Workers in the geographic area. Daytime Workers include population age 16+ who are civilian, non-military at work (commuters and non-commuters), and armed forces (on and off base). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOPRES_CY":{"type":"number","alias":"2025 Daytime Pop: Residents","vintage":"2025","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Daytime Population who are Residents in the geographic area. Daytime Residents include population age 0-15; unemployed adults; those not in the Labor Force such as retirees, homemakers, college students, residents of institutions and non-institutional group homes, detention centers and shelters; and employed civilians who are temporarily not working due to illness, vacation, bad weather, labor dispute, etc. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC0_CY":{"type":"number","alias":"2025 HH Income <$15000","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income <$15,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC15_CY":{"type":"number","alias":"2025 HH Income $15000-24999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $15,000-$24,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC25_CY":{"type":"number","alias":"2025 HH Income $25000-34999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $25,000-$34,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC35_CY":{"type":"number","alias":"2025 HH Income $35000-49999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $35,000-$44,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC50_CY":{"type":"number","alias":"2025 HH Income $50000-74999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $50,000-$74,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC75_CY":{"type":"number","alias":"2025 HH Income $75000-99999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $75,000-$99,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC100_CY":{"type":"number","alias":"2025 HH Income $100000-149999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $100,000-$149,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC150_CY":{"type":"number","alias":"2025 HH Income $150000-199999","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $150,000-$199,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC200_CY":{"type":"number","alias":"2025 HH Income $200000+","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the number of Households with Income $200,000+ in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHWLTHINDXCY":{"type":"number","alias":"2025 Wealth Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSEHOLDTOTALSHAI_CY":{"type":"number","alias":"2025 Housing Affordability Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2025 Diversity Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2025 Median Home Value","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2025-2030 Growth Rate: Population","vintage":"2030","source":"Esri","units":null,"decimals":null,"definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOMEVALUEVAL0_CY_P":{"type": ulator","templateName":"dataCollectionsCalculator.POLICYHINC150_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the number of Households with Income $150,000-$199,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.POLICYHINC200_CY":{"id":"HINC200_CY","fullName":"Policy.HINC200_CY","alias":"2025 HH Income $200000+","fieldName":"POLICYHINC200_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.POLICYHINC200_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the number of Households with Income $200,000+ in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHWLTHINDXCY":{"id":"WLTHINDXCY","fullName":"Wealth.WLTHINDXCY","alias":"2025 Wealth Index","fieldName":"WEALTHWLTHINDXCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHWLTHINDXCY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 Wealth Index summarizes the wealth of a geographic area relative to the national level. Wealth is calculated from a number of indicators of affluence that include household income and average net worth. The concept of wealth is defined by more than just above-average household income; it also includes the value and abundance of material possessions and resources. Esri captures both aspects in its identification of the wealthiest areas in the country. The national index value is set to 100: values exceeding 100 represent above-average wealth while values below 100 represent below-average wealth. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSEHOLDTOTALSHAI_CY":{"id":"HAI_CY","fullName":"householdtotals.HAI_CY","alias":"2025 Housing Affordability Index","fieldName":"HOUSEHOLDTOTALSHAI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSHAI_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY":{"id":"DIVINDX_CY","fullName":"KeyUSFacts.DIVINDX_CY","alias":"2025 Diversity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2025 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2025-2030 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2030","source":"Esri","definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is some ity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":1,"calculatorName":"comparison_3","templateName":"comparison_3.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"comparison_4.POPULATIONTOTALSPOPDENS_CY":{"id":"POPDENS_CY","fullName":"populationtotals.POPDENS_CY","alias":"2025 Population Density","fieldName":"POPULATIONTOTALSPOPDENS_CY","precision":1,"calculatorName":"comparison_4","templateName":"comparison_4.POPULATIONTOTALSPOPDENS_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Population Density (population per Square Mile) in the geographic area. Population density is computed by dividing the total population within the geographic area by the total land area, measured in square miles. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."}}},"mapData":{"viewAs":"map","loadedPortalItems":{"itemIds":{},"mapNames":{}}},"countryConfig":{"country":{"id":"US","currencySymbol":"$","currencyFormat":"$0;-$0"},"hierarchy":"esri2025","geographiesModel":{"levels":[{"id":"US.WholeUSA","name":"Entire Country","pluralName":"United States of America","singularName":"United States of America","isWholeCountry":true,"adm
